import React from "react"
import Head from "./Head.js"
import ChooseMenu from "./ChooseMenu.js"
import 'bootstrap/dist/css/bootstrap.min.css';
import "./style.css"
import { Collapse } from "react-bootstrap";


class App extends React.Component {
  constructor(props){
    super(props)
    this.state={
      homemenustart:false,
      homemenu:false,
      wait:""
    }
  }
  sethomemenu(event){
    this.setState({wait:500})
    this.setState({homemenu:event}) 
    this.space(event);
  }
  space(event){
    if(event){
      setTimeout(function() {
        this.setState({homemenustart:event})
      }.bind(this), 100);  
    }    
  }
  render() {
    return (
      <body >
        <div className="APPbackground">
          <Head/>    
          <Collapse  in={this.state.homemenu}>
            <div><ChooseMenu/></div>
          </Collapse>        
          <Collapse  in={!this.state.homemenustart}>
            <card>
            <div className="center APPtexthead"><h6>NUMERIC</h6><br/><pre>Website นี้จัดทำขึ้นเพื่อเอาคะแนนวิชา Numeric<br/>โดยข้าพเจ้ามีคะแนนสอบ Midterm เพียง 6.67 เต็ม 40 คะแนน ซึ่ง Mean อยู่ที่ 6.12 คะแนน<br/>ข้าพเจ้าหวังอย่างยิ่งว่าอาจาร์ยจะเมฆตาให้คะแนนข้าพเจ้าพ้น F วิชานี้</pre></div>
            <div className="homemenutop"></div>
              <button 
              onClick={()=>this.sethomemenu(!this.state.homemenustart)}
              className="btn btn-lg btn-outline-info menustartcss"
              >start
            </button>
            <div className="homemenubottom"></div>
            </card>
          </Collapse >
        </div>
        <footer className="footer center">
          <div>Made By <a href="https://www.facebook.com/title.tawan" target="_self">Title Tawan.</a></div >
        </footer>
      </body>
    )
  }
}

export default App;
